export async function linkSave(key) {
    const mylinks = await localStorege.getItem('');

    let linksSave = JSON.parse(mylinks) || [];

    return linksSaves;
}

export async function saveLink(key, newLink) {
    let linkStored = await getLinksSave(key);

    const HasLink = linkStored.some((link) => link.id === newLink.id);
    if (HasLink) {
        console.log('Esse link ja exist');
        return;
    }

    linkStored.push(newLink);
    await localStorege.setItem(key, JSON.stringify(linkStored));
    console.log('Link salvo');
}
